import React from 'react';
import imgTable from '../assets/cycles_status_table.JPG';
import './CycleTable.css';
import Loader from '../reusableComponents/Loader';


const cycle_title="CHAZ_UFS_Swift_HW_HUAWEI_ShenzhenJL_FW_30b.1058.35235_CTF44_SDR4.4U_1.6.0014.34721_CTF4U_1.5.0007.33788_VLD_1.0.35105";

const CycleTable=(props)=>{

    let view=null;
    let rows= props.data.map((row)=>{return(
        <tr key={row.ID}>
            <th>{row.ID}</th>
            <th className="wrapLongWord">{row.Description}</th>
            <th>{row.Ex_Running}</th>
            <th>{row.Ex_Pending}</th>
            <th>{row.Ex_Completed}</th>
        </tr>)
    });

    if (props.data.length>0)
    {

        view =
            <table >
            <thead >
            <tr >
                <th>Cycle ID</th>
                <th className="colWidth">Cycle Name</th>
                <th>Ex. Running</th>
                <th>Ex. Pending</th>
                <th>Ex. Completed</th>
            </tr>
            </thead>
            <tbody >
            {rows}
            </tbody>
            <tfoot>
            <tr >
                <th></th>
                <th></th>
                <th>0</th>
                <th>3</th>
                <th>90</th>
            </tr>
            </tfoot>
        </table>

    }
    else{
        view=<Loader/>
    }
    return(
        <div>
            <div className="ui fixed table" >
                {view}
            </div>
        </div>
    )
}

export default CycleTable;
